webpackJsonp([50,428],{24:function(e,t){e.exports="data:image/png;base64,"},246:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/hvor_i_all_verden/reisemaal.52aec0.png"},1580:function(e,t,l){e.exports={frontmatter:l(587),content:l(2764)}},2764:function(e,t,l){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p>Hvor i All Verden? er et reise- og geografispill hvor man raskest mulig skal fly innom reisemål spredt rundt i Europa. Dette er den andre leksjonen av tre. Her skal vi spesielt se på hvordan vi kan gjøre kartet større enn skjermen, ved å la kartet rulle i bakgrunnen. Underveis vil vi se litt nærmere på hva et koordinatsystem er.</p> <p>I den siste leksjonen vil lage lister som gjør det enklere å legge til mange reisemål. Vi vil også lage en skikkelig intro til spillet.</p> <figure><img src="+l(3500)+' alt=""></figure> </section> <section class=activity id=steg-0-forrige-gang> <h1 class=activity id=steg-0-forrige-gang>Steg 0: Forrige gang</h1> <p><em>Vi vil nå fortsette med det programmet vi laget i del 1.</em></p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <p>Siden vi skal forandre og videreutvikle flere ting trenger ikke spillet du laget i del 1 være helt perfekt. Sjekk likevel at</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_0><label for=cbx_0> du har et helikopter som du kan styre rundt på skjermen med piltastene, og</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_1><label for=cbx_1> du har en stedfigur som kan bli funnet av helikopteret.</label></p> </li> </ul> <p>Hvis ikke disse tingene fungerer så gå tilbake til del 1 og gjør dem ferdige.</p> </section> </section> <section class=activity id=steg-1-bakgrunnen-som-figur> <h1 class=activity id=steg-1-bakgrunnen-som-figur>Steg 1: Bakgrunnen som figur</h1> <p><em>Vi vil nå at bakgrunnen skal bli flyttbar. Vanlige bakgrunner i Scratch kan ikke flyttes. Vi må derfor &quot;jukse litt&quot;, og la bakgrunnen være en figur.</em></p> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_2><label for=cbx_2> Slett <code>Europakart</code>-bakgrunnen din. En helt hvit bakgrunn vil passe bra nå.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_3><label for=cbx_3> Lag en ny figur ved å klikke <img src='+l(24)+' alt="Last opp figur fra fil"> ved siden av <code>Ny figur</code>. Velg filen <code>europakart.png</code> som du lastet ned forrige gang. Hvis du ikke har denne lett tilgjengelig kan du laste den ned på nytt fra <a href=europakart.png>europakart.png</a>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_4><label for=cbx_4> Gi denne nye kartfiguren navnet <code>Kart</code>.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_5><label for=cbx_5> For å være sikre på at denne figuren ligger bakerst som en bakgrunn kan vi starte med følgende kode:</label></p> <pre class=blocks>når grønt flagg klikkes\nflytt bakover (50) lag\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_6><label for=cbx_6> Vi vil nå lage denne figuren så stor som mulig. Dessverre har Scratch en begrensning på hvor store figurer kan være. Du kan se dette om du først krysser av for at <code class=blocklooks>størrelse</code> skal vises på kart-figuren. Deretter kan du endre størrelsen med</label></p> <pre class=blocks>sett størrelse til (9999) %\n</pre> <p>Du vil se at størrelsen ikke blir satt til <code>9999</code>, men til et mindre tall. Legg på en kloss som setter så stor størrelse som mulig på kartet når det grønne flagget klikkes.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_7><label for=cbx_7> Til bruk senere, når vi skal lage en intro til spillet, er det greit å <code class=blocklooks>skjule</code> kartfiguren når det grønne flagget klikkes.</label></p> </li> </ul> </section> </section> <section class=activity id=koordinatsystemer> <h1 class=activity id=koordinatsystemer>Koordinatsystemer</h1> <p>I del 1 så vi såvidt hvordan vi bruker koordinater for å beskrive hvor helikopteret og reisemålet er på skjermen (og på kartet). Om du trykker <code class=blockmotion>i</code> på en figur vil du alltid se koordinatene til figuren, som to tall <code>x</code> og <code>y</code>.</p> <figure><img src='+l(246)+' alt=""></figure> <p>Midt på skjermen har koordinatene <code>x: 0</code> og <code>y: 0</code>. Ellers beskriver <code>x</code> hvor et punkt er sideveis. Dersom <code>x</code> er mindre enn null er punktet til venstre for midten, mens om <code>x</code> er positivt er punktet til høyre for midten. På samme måte sier <code>y</code> hvor høyt på skjermen et punkt er. <code>y</code> større enn null betyr at punktet er over midten, mens et punkt med negativ <code>y</code> vil være nedenfor midten av skjermen.</p> <figure><img src='+l(3502)+' alt=""></figure> <p>Vanligvis passer Scratch på disse koordinatene for oss, slik at vi ikke trenger å tenke så mye på dem.</p> <p>Men nå skal vi gjøre noe litt spesielt. Vi vil skape en illusjon hvor det ser ut som om helikopteret flytter på seg, mens det egentlig er bakgrunnen som flytter seg. For å gjøre dette må vi lage våre egne <code>X</code>- og <code>Y</code>-variabler som vi bruker til å koble helikopteret, stedet og bakgrunnen.</p> </section> <section class=activity id=steg-2-nye-kontroller-for-helikopteret> <h1 class=activity id=steg-2-nye-kontroller-for-helikopteret>Steg 2: Nye kontroller for helikopteret</h1> <p><em>Vi vil først endre hva som skjer når vi trykker på piltastene.</em></p> <section class=check id=sjekkliste-3> <h2 class=check id=sjekkliste-3>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_8><label for=cbx_8> Lag to nye variabler som gjelder for alle figurer. Disse skal hete <code>X</code> og <code>Y</code>, og vil beskrive hvor helikopteret er i forhold til kartet.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_9><label for=cbx_9> Vi skal nå endre hva som skjer når du trykker på piltastene. I stedet for at helikopteret skal</label></p> <pre class=blocks>gå (hastighet) steg\n</pre> <p>vil vi endre <code class=blockdata>X</code> eller <code class=blockdata>Y</code> med <code class=blockdata>hastighet</code> eller med</p> <pre class=blocks>((0) - (hastighet))\n</pre> <p>Oppdater alle fire hvis-løkkene på helikopteret.</p> </li> </ul> </section> <section class=flag id=test-prosjektet> <h2 class=flag id=test-prosjektet>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_10><label for=cbx_10> Helikopteret skal nå <strong>ikke</strong> flytte seg når du trykker på piltastene. Hvis helikopteret flytter seg må du slette <code class=blockmotion>gå</code>-klossene.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_11><label for=cbx_11> Helikopteret skal fortsatt snu seg til høyre eller venstre når du trykker på piltastene.</label></p> </li> </ul> </section> </section> <section class=activity id=steg-3-flytt-kartet> <h1 class=activity id=steg-3-flytt-kartet>Steg 3: Flytt kartet</h1> <p><em>Vi kan nå flytte kartet når helikopteret flyr rundt omkring.</em></p> <section class=check id=sjekkliste-4> <h2 class=check id=sjekkliste-4>Sjekkliste</h2> <p>Dette steget er egentlig ganske lett. Det eneste vi må passe er at vi skal flytte kartet <strong>motsatt</strong> vei av hva helikopteret skal fly. For eksempel, om vi vil at det skal se ut som om helikopteret flytter seg oppover må vi flytte kartet nedover.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_12><label for=cbx_12> Legg til denne koden på kartet:</label></p> <pre class=blocks>når jeg mottar [Nytt spill v]\nvis\nfor alltid\n    gå til x: ((0) - (X)) y: ((0) - (Y))\nslutt\n</pre> </li> </ul> </section> <section class=flag id=test-prosjektet-2> <h2 class=flag id=test-prosjektet-2>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_13><label for=cbx_13> Ser det ut som om helikopteret flytter på seg når du trykker på piltastene?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_14><label for=cbx_14> Se nøye etter. Ser du at helikopteret faktisk står på samme sted hele tiden?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_15><label for=cbx_15> Hva skjer om du flyr ut av kartet?</label></p> </li> </ul> </section> <section class=challenge id=utfordring> <h2 class=challenge id=utfordring>Utfordring</h2> <p>Hvordan kan du begrense hvor helikopteret flyr? Kan du legge på kode slik at helikopteret ikke kan fly ut av kartet?</p> </section> </section> <section class=activity id=steg-4-la-stedet-folge-med> <h1 class=activity id=steg-4-la-stedet-folge-med>Steg 4: La stedet følge med</h1> <p><em>Vi må nå la reisemålet også flytte seg med kartet.</em></p> <section class=check id=sjekkliste-5> <h2 class=check id=sjekkliste-5>Sjekkliste</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_16><label for=cbx_16> Det er litt vanskelig å teste når vi har gjort reisemålet usynlig. Endre derfor på gjennomsiktigheten til sted-figuren. For eksempel kan du sette</label></p> <pre class=blocks>sett [gjennomsiktig v] effekt til (50)\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_17><label for=cbx_17> For at det skal se ut som om stedet ligger i ro på kartet må faktisk sted-figuren flytte seg sammen med kartet. Vi behøver da to variabler som holder rede på hvor stedet skal ligge i forhold til kartet. Lag to variabler som heter <code>stedX</code> og <code>stedY</code>. Begge disse skal gjelde kun for sted-figuren.</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_18><label for=cbx_18> Bytt ut</label></p> <pre class=blocks>gå til x: (-98) y: (-120)\n</pre> <p>med kode som setter variablene i stedet:</p> <pre class=blocks>sett [stedX v] til [-98]\nsett [stedY v] til [-120]\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_19><label for=cbx_19> Vi kan nå lage en helt ny blokk som flytter stedet rundt på skjermen.</label></p> <pre class=blocks>når jeg mottar [Nytt spill v]\nfor alltid\n    gå til x: ((stedX) - (X)) y: ((stedY) - (Y))\nslutt\n</pre> <p>Prøv spillet. Flytter den røde prikken seg rundt på kartet?</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_20><label for=cbx_20> Du ser kanskje at den røde prikken ikke lenger ligger ved Barcelona? Det er fordi vi har laget et større kart. Da stemmer ikke lengre de gamle koordinatene.</label></p> <p>Endre verdiene for <code>X</code> og <code>Y</code> til det ser ut som om reisemålet ligger omtrent på riktig sted igjen.</p> </li> </ul> </section> </section> <section class=activity id=steg-5-flere-steder> <h1 class=activity id=steg-5-flere-steder>Steg 5: Flere steder</h1> <p><em>Vi skal nå se på hvordan vi relativt enkelt kan legge til flere reisemål i spillet vårt.</em></p> <section class=check id=sjekkliste-6> <h2 class=check id=sjekkliste-6>Sjekkliste</h2> <p>Om du bare ser på koden vi har lagt på sted-figuren kan det se ut som om det er mye arbeid å legge til et nytt reisemål. Men om vi ser litt nøyere oppdager vi at om vi vil ha et nytt sted å reise til kan vi bruke mye av den samme koden. Vi må bare endre navnet (<code class=blockdata>Reis til</code>) og koordinatene (<code class=blockdata>X</code> og <code class=blockdata>Y</code>).</p> <p>Dette er et bra eksempel på når det kan lønne seg å bruke funksjoner, eller lage egne klosser som man gjør i Scratch.</p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_21><label for=cbx_21> Klikk på <code class=blockmoreblocks>Flere klosser</code> og lag en kloss som ser slik ut:</label></p> <figure><img src='+l(3504)+' alt=""></figure> <p>hvor <code>sted</code> er tekst, mens <code>x</code> og <code>y</code> er tallverdier:</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_22><label for=cbx_22> Etter at du klikker <code>OK</code> dukker det opp en ny kloss på skjermen:</label></p> <pre class=blocks>definer Reis til (sted) (x) (y)\n</pre> <p>Under denne klossen kan vi definere hva funksjonen vår skal gjøre.</p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_23><label for=cbx_23> Flytt skriptet ditt fra <code class=blockevents>Nytt sted</code>-blokken til den nye funksjonen, og endre litt - spesielt i variablene - slik at funksjonen din ser slik ut:</label></p> <pre class=blocks>definer Reis til (sted) (x) (y)\nsett [gjennomsiktig v] effekt til (100)\nsett [stedX v] til (x)\nsett [stedY v] til (y)\nsett [Reis til v] til (sted)\nvent til &lt;berører [Helikopter v]?&gt;\nsett [gjennomsiktig v] effekt til (0)\nsi (sett sammen [Fant ] (sted))\ngjenta (5) ganger\n    gjenta (10) ganger\n        endre størrelse med (10)\n    slutt\n    gjenta (10) ganger\n        endre størrelse med (-10)\n    slutt\nslutt\nsi []\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_24><label for=cbx_24> Til slutt kan vi endre på <code class=blockevents>Nytt spill</code>-blokken slik at vi bruker den nye funksjonen. For eksempel</label></p> <pre class=blocks>når jeg mottar [Nytt spill v]\nvis\nReis til [London] (-135) (-30) :: custom\nReis til [Oslo] (-30) (75) :: custom\nReis til [Barcelona] (-135) (-175) :: custom\n</pre> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_25><label for=cbx_25> Om du prøver spillet nå vil du kanskje oppdage et lite problem. Dersom du ikke flytter deg etter å ha funnet det første reisemålet, vil det neste reisemålet bli funnet automatisk. Det er fordi vi ikke rekker å flytte sirkelen før vi tester om den berører helikopteret.</label></p> <p>Den enkleste måten å løse dette på er å legge på klossen</p> <pre class=blocks>vent til &lt;ikke &lt;berører [Helikopter v]?&gt;&gt;\n</pre> <p>rett før vi venter til helikopteret berøres inne i funksjonen vår.</p> </li> </ul> </section> <section class=flag id=test-prosjektet-3> <h2 class=flag id=test-prosjektet-3>Test prosjektet</h2> <p><strong>Klikk på det grønne flagget.</strong></p> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_26><label for=cbx_26> Flyr helikopteret rundt på kartet på en naturlig måte?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_27><label for=cbx_27> Fungerer reisemålene slik de skal? Ligger de omtrent der de skal ligge?</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_28><label for=cbx_28> Kan du reise til flere reisemål på rad?</label></p> </li> </ul> </section> </section> <section class=activity id=neste-gang> <h1 class=activity id=neste-gang>Neste gang</h1> <p>Spillet vårt har blitt ganske mye kulere nå! Neste gang skal vi gjøre spillet ferdig ved å lage lister som gjør det enklere å lage en tilfeldig reiserute. Vi skal også se hvordan vi kan lage en intro til spillet, samt legge på en tidsbegrensning og poengsum.</p> <section class=try id=prov-selv> <h2 class=try id=prov-selv>Prøv selv</h2> <ul class=task-list> <li class=task-list-item> <p><input type=checkbox id=cbx_29><label for=cbx_29> Kan du legge til flere reisemål på egen hånd? Husk at det er lurt å gjøre reisemålet synlig mens du tester. Da blir det enklere å finne koordinatene til reisemålet!</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_30><label for=cbx_30> Spillet blir morsommere hvis ikke reisemålene kommer i samme rekkefølge hver gang du spiller. Hvordan kan du få reisemålene til å komme i tilfeldig rekkefølge? Prøv å lage kode som gjør dette!</label></p> </li> <li class=task-list-item> <p><input type=checkbox id=cbx_31><label for=cbx_31> Fortsatt er ikke kartet så veldig stort. En måte å komme seg rundt begrensningen på figurstørrelse i Scratch er å la bakgrunnen bestå av flere deler. Filen <a href=europakart.zip>europakart.zip</a> inneholder 9 kartfliser du kan prøve å pusle sammen. Du må da laste inn hver av dem som en egen figur. Hver av dem trenger omtrent samme kode som kartet vi har brukt så langt. Du må bare endre litt i <code class=blockmotion>gå til</code>-klossene.</label></p> </li> </ul> </section> </section> '},3500:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/hvor_i_all_verden/hvor_i_all_verden_2.81e646.png"},3502:function(e,t){e.exports="data:image/png;base64,"},3504:function(e,t,l){e.exports=l.p+"_/oppgaver/src/scratch/hvor_i_all_verden/nykloss.2e31b1.png"}});